import { Component } from "react";
import "tachyons";

class Card extends Component{
    render(){
        const { name, email } = this.props;
        return(
        <div className="w-90 bg-light-blue center br3 shadow-1 grow1">
            <h1>{name}</h1>
            <h2>{email}</h2>
        </div>
        )
    }
}
export default Card;
